import{_ as e,o as t,c as r,O as a}from"./chunks/framework.9482e208.js";const u=JSON.parse('{"title":"§ 23.1-2426 Chapter liberally construed.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/23.1-2426.md","filePath":"vacode/23.1-2426.md"}'),o={name:"vacode/23.1-2426.md"},i=a('<h1 id="§-23-1-2426-chapter-liberally-construed" tabindex="-1">§ 23.1-2426 Chapter liberally construed. <a class="header-anchor" href="#§-23-1-2426-chapter-liberally-construed" aria-label="Permalink to &quot;§ 23.1-2426 Chapter liberally construed.&quot;">​</a></h1><p>This chapter shall constitute full and complete authority, without regard to the provisions of any other law, for the performance of acts authorized in the chapter and shall be liberally construed to effect the purposes of the chapter. Insofar as the provisions of this chapter are inconsistent with the provisions of any other general, specific, or local law, the provisions of this chapter control.</p><p>1996, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?961+ful+CHAP0905" target="_blank" rel="noreferrer">905</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?961+ful+CHAP1046" target="_blank" rel="noreferrer">1046</a>, § 23-50.16:33; 2016, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?161+ful+CHAP0588" target="_blank" rel="noreferrer">588</a>.</p>',3),l=[i];function n(s,c,h,p,_,f){return t(),r("div",null,l)}const g=e(o,[["render",n]]);export{u as __pageData,g as default};
